  \"Contaminant biomonitoring at the Benton Lake National Wildlife Refuge in 1988\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:47.797002\",\n\t\"name\": \"contaminant-biomonitoring-at-the-benton-lake-national-wildlife-refuge-in-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Trace element concentrations in sediment
  samples from Benton Lake National Wildlife Refuge were not elevated relative to
  the western U.S. geometric mean concentrations. Boron concentrations in aquatic
  plants approached the concentration of boron in Mallard (Anas platyrhyncos) diets
  that reduced hatching success. Among the three invertebrate taxa sampled, only midge
  larvae (Chironomidae) bioaccumulated selenium. Selenium concentrations in Eared
  Grebe livers exceeded the levels found in the livers of Mallards that experienced
  reproductive problems. Four hundred thirty-eight water bird nests were located during
  nest searches, and 536 eggs were examined from 179 of those nests. A minimum of
  8.4% of the eggs laid contained dead embryos, and 0.1% contained abnormal embryos.
  Rates of embryo death and abnormality were similar to rates of presumably unpolluted
  natural populations. Mean selenium concentrations in Eared Grebe, Northern Pintail
  (Anas acuta), Mallard, and American Coot (Fulica americana) eggs exceeded the 3
  microgram/gram dry weight concentration typical of natural background levels. However,
  only one of three deformed bird embryos had a selenium concentration greater than
  3 microgram/gram dry weight. Organochlorine residues in bird eggs did not exceed
  concentrations believed to be harmless\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
